import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a className="navbar-brand" href="/"
        style={{ textAlign: "center" }}
      >
        HouseWork
      </a>
      <div id="loginSignUp" style={{ float: "right" }}>
        <button className="btn btn-light" data-toggle="modal" data-target="#modal-log-in" id="logInBtn" uk-toggle style={{ float: "right" }}>Log In</button>
        <button className="btn btn-light" data-toggle="modal" data-target="#modal-sign-up" id="signUpBtn" uk-toggle style={{ float: "left" }}>Sign Up</button>
      </div>

      

    </nav>
  );
}

export default Nav;
